<style>
#map {
    float: left;
    max-height: 100vh;
}
#map svg {
    height: 100%;
}

#map-nav {
    width: 200px;
    border: 1px solid black;
    position:fixed;
    right: 0;
    top:50px;
}

#map svg path[id^="Venue"]{
    opacity: 0.4;
}
</style>
<script>    
    function clearVenues(){
        allVenues = document.querySelectorAll('path[id^="Venue"]');
        for (let i = 0; i < allVenues.length -1; i++) {
            allVenues[i].style.opacity = 0.4;
            allVenues[i].setAttribute("fill", "#919191");
            allVenues[i].setAttribute("stroke", "#ffffff");
        }
    }

    function select(venue){
        venue = venue.replace("&amp;", "&");
        console.log(venue);
        clearVenues();
        myVenue = document.querySelector('path[id="Venue '+venue+'"]');
        myVenue.style.opacity = 1;
        myVenue.setAttribute("fill", "#ff0000");
        myVenue.setAttribute("stroke", "#000000");
    }
</script>
